import React, { useState } from "react";
import {
  Home,
  Search,
  FileText,
  Globe,
  Users,
  Settings,
  HelpCircle,
} from "lucide-react";

const Dashboard = () => {
  const [isExpanded, setIsExpanded] = useState(false);

  const navItems = [
    { icon: Home, label: "Home", path: "/" },
    { icon: Search, label: "Search", path: "/search" },
    { icon: FileText, label: "Documents", path: "/documents" },
    { icon: Globe, label: "World", path: "/world" },
    { icon: Users, label: "Community", path: "/community" },
    { icon: Settings, label: "Settings", path: "/settings" },
    { icon: HelpCircle, label: "Help", path: "/help" },
  ];

  return (
    <div className="flex h-screen bg-gray-50">
      {/* Sidebar */}
      <aside
        className={`bg-white shadow-sm transition-all duration-300 ${
          isExpanded ? "w-64" : "w-16"
        }`}
      >
        <div className="h-16 flex items-center justify-center">
          <button
            onClick={() => setIsExpanded(!isExpanded)}
            className="p-2 hover:bg-gray-200 rounded-lg"
          >
            {/* Toggle Button */}
            {isExpanded ? "<" : ">"}
          </button>
        </div>

        <nav className="mt-4">
          {navItems.map((item, index) => (
            <a
              key={index}
              href={item.path}
              className="flex items-center gap-4 px-4 py-3 hover:bg-gray-100 transition-colors"
            >
              {/* Icon */}
              <item.icon className="text-gray-600" />
              {/* Label */}
              {isExpanded && <span className="text-gray-700">{item.label}</span>}
            </a>
          ))}
        </nav>
      </aside>



    </div>
  );
};

export default Dashboard;
